refetch.value:
function refetch(page) {
  console.log("page:", page);

  if (!page) {
    page = 1;
  }

  this.dataSourceMap.info.load({
    offset: (page - 1) * 10
  }).then(data => {
    this.setState({
      info: data
    });
  });
}

onCreate.value:
function onCreate(value) {
  console.log(value);
  fetch('/grpc/whale.account.proto.CompanyService/Create', {
    method: "POST",
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
      "name": value.name,
      "slug": value.slug,
      "type": value.type,
      "phone": value.phone
    })
  }).then(() => {
    closeShowCreateDialog();
    refetch();
  });
}

